import React from 'react';
import './Content.css';

let customData = require('./data.json')

/*


function SectionTitle(props) {
    return (
        <div className="TitleContainer">
            <h2>{props.title}</h2>
        </div>
    )
}

function IntroContent() {
    return (
        <div classname="IntroContentWrapper">
            <p>{customData[0].intro.text}</p>
        </div>
    )
}

function IntroContentBlock() {
    return (
        <div name="BlockWrapper">
            <SectionTitle title="About Me" />
            <IntroContent />
        </div>
    )
}
*/

function IntroContentBlock() {
    return (
        <div className="BlockContainer">
            <h2 className="BlockTitle">About Me:</h2>
            <p>{customData[0].intro.text}</p>
        </div>
    )
}


export default IntroContentBlock
